ng:"Dessiner le tableau :",faq3_a_li5_text:" Compiler toutes les informations dans un tableau de variation complet, y compris la variation de f(x) et ses valeurs extrmes.",faq4_q:"Comment dessiner un tableau sur un intervalle spcifique ?",faq4_a:`Pour dessiner un tableau de variation sur un intervalle spcifique, il suffit de cocher la case "Dessiner sur un intervalle". Des champs de saisie pour le "Point de dpart" et le "Point d'arrive" apparatront, vous permettant d'entrer la plage souhaite (par exemple, de -5  5).`,faq5_q:"Comment ajouter des paramtres (m, k, ...) au tableau ?",faq5_a:"Une fois le tableau de variation gnr, vous pouvez modifier directement les valeurs dans le tableau. Il suffit de cliquer sur la cellule que vous souhaitez modifier (par exemple, une valeur de x ou de f(x)) et d'entrer les caractres que vous voulez, comme 'm', 'f(m)' ou '2m+1'. L'outil mettra  jour le tableau avec votre nouvelle valeur.",faq6_q:"Que faire si le site web met beaucoup de temps  traiter ?",faq6_a:"En raison de bugs mineurs ou de problmes temporaires, le processus peut se bloquer. Si vous remarquez que le site web met trop de temps  rpondre, essayez de recharger la page (appuyez sur F5 ou sur le bouton de rechargement de votre navigateur) et ressayez. Cela rsout gnralement le problme.",faq7_q:"Pourquoi les rsultats sont-ils arrondis et comment voir les valeurs exactes ?",faq7_a_p1:"L'interface web a des limites pour afficher des formules mathmatiques complexes (comme les radicaux, les fractions, les constantes `pi`, `e`, etc.), donc les valeurs numriques sont arrondies pour faciliter l'affichage.",faq7_a_p2:"Pour voir le tableau de variation avec les rsultats exacts, utilisez les fonctionnalits <strong>'Voir l'image'</strong> ou <strong>'Ouvrir dans Overleaf'</strong>. Ces fonctions gnreront une image de haute qualit ou un document LaTeX, en conservant toutes les valeurs mathmatiques prcises (par exemple, <code>sqrt(2)/2</code> au lieu de <code>0.71</code>).",developedBy